import React from 'react';
import { Routes, Route } from 'react-router-dom';

import BeeroscopePage from './Horoscope'
import ClientSearchPage from './Search'

const Main = () => {
    return (
        <Routes>
            <Route exact path='/' component={BeeroscopePage}></Route>
            <Route exact path='/search' component={ClientSearchPage}></Route>
        </Routes>
    );
}

export default Main;
